[#Energía](https://www.picuki.com/tag/Energía) [#Maestría](https://www.picuki.com/tag/Maestría) [#Tesis](https://www.picuki.com/tag/Tesis) [#Energìa](https://www.picuki.com/tag/Energìa) [#FIME](https://www.picuki.com/tag/FIME) [#UANL](https://www.picuki.com/tag/UANL) [#LIITE](https://www.picuki.com/tag/LIITE) [#GETR](https://www.picuki.com/tag/GETR) [#LandacBio](https://www.picuki.com/tag/LandacBio)Se invita a la comunidad académica de la FIME y al público en general a presenciar la defensa de Tesis titulada: "Caracterización físicoquímica y análisis de emisiones de mezclas diésel-biodiésel-aceite ligero en motores de encendido por compresión", del programa de Maestría en Ciencias de la Ingeniería con Orientación en Energías Térmica y Renovable, y que pertenece a la Línea de Generación y Aplicación del Conocimiento “Nuevos Sistemas Energéticos”. La defensa será realizada por la Ing. Vanessa Manrique Guio y se llevará a cabo éste Miércoles 26 de febrero de 2020 en el auditorio Raúl Quintero, piso 1 del Centro de Investigación y Desarrollo Tecnológico (CIDET) a las 12:00 horas.
